local cuenta = 0
local funcionando = false

RegisterNetEvent('obtengoinfode:estetio')
AddEventHandler('obtengoinfode:estetio', function(aquienescaneo, aquienlenvio)



    

    local xPlayer = ESX.GetPlayerFromId(aquienescaneo)

    --dinero
    local dinero = xPlayer.getMoney()
    local dinerobanco = xPlayer.getAccount("bank")["money"]
    local dineronegro = xPlayer.getAccount("black_money")["money"]


    -- trabajos
    local trabajonombre = xPlayer.job.label
    local trabajocargo = xPlayer.job.grade_label

    local trabajonombre = xPlayer.job.label
    local trabajocargo = xPlayer.job.grade_label

    local nombre = xPlayer.getName()

    
    local grupobuscando = xPlayer.getGroup()

    if grupobuscando == "superadmin" then
        grupo = 'Super-Admin'
    elseif grupobuscando == "admin" then
        grupo = 'Administrador'
    elseif grupobuscando == "mod" then
        grupo = 'Moderador'
    elseif grupobuscando == "user" then
        grupo = 'Usuario'
    end

    ip = GetPlayerEndpoint(aquienescaneo)

    


    TriggerClientEvent('recibolainfode:alguien', aquienlenvio, dinero, dinerobanco, dineronegro, trabajonombre, trabajocargo, nombre, grupo, ip)

end)











